    markingSchemaName : {
        type : String,
        required : true
    },
    markingSchemaNumber : {
        type : String,
        required : true
    },
    addedDate : {
        type : Date,
        required : true
    },
    markingSchemaCategory : {
        type : String,
        required : true
    },
    markingSchemaStatus : {
        type : String,
        required : true
    }
});


module.exports = mongoose.model("MarkingSchema", markingSchemaSchema);
